import { ADD_ROW, DELETE_ROW } from "./constants"

export const addRow = () =>{
    return {
        type : ADD_ROW
    }
}

export const deletRow = () =>{
    return {
        type : DELETE_ROW,
        payload : 0
    }
}

export const increment = () =>{
    return {
        type : 'increment',
        payload : 1
    }
}
